  false,\n\t\"url\": null,\n\t\"notes\": \"This memorandum summarizes the 2012 baseline
  monitoring of stream flows on Fort Niobrara National Wildlife Refuge. Stream flow
  measurements were collected bi-weekly March 20 u2013 November 20, 2012 at established
  monitoring sites on 10 streams. The objective of this survey is to document flow
  rates and fluctuations across and between years for various streams on Fort Niobrara
  National Wildlife Refuge and analyze for trends after sufficient data are available.\",\n\t\"owner_org\":
